Which ones your favorite ? Comment 1 to 6 👇🏻👇🏻😉

Maybe we get @therock to try this next ? 
@underarmour @underarmourwomen

You keep saying you’re too old, too weak & too heavy to get a pull-up 🙄 

But what if..you’re wrong…

What if, the one thing holding you back from conquering the pull-ups, a skill that you’ve wanted now for YEARS… is your mindset…what if…it’s actually more possible than you think?

@homebodytrainer & @angela_gargano have teamed up to help teach you proven strategies to overcome these limiting beliefs and make pull-up a reality for you in a FREE Online Pull-up Workshop on June 28th EST at 6pm EST! 

@angela_gargano  a 5x Ninja Warrior, Oxygen Cover Girl and trainer with 10+ years experience has helped over 500+  of her female (& male) clients conquer their pull-up with her @pulluprevolution program 

@homebodytrainer is 63 years old and continues to challenge herself, show-up and inspire thousands of people from all over the world that age is doesn’t need to hold you back from your goals 

So if you’re looking for a sign and looking for the right moment to get going with these pull-up goals….this is IT, you do NOT want to miss this! 

Comment “Workshop” below OR head to my link in bio to register for FREE! 👇🏻👇🏻

USE: “HOMEBODYTRAINER” in the how you heard about us section!

These women inspire the hell out of me. 

They are living proof that age is in fact just a number. 

No matter what age you are or where you are at in your life you can try something new 🥰

@ginnymaccoll 71 year old Ninja Warrior got her first pull-up at 63 years old total inspiration. She was a guest on this Months FREE Pull-up Workshop (DM me Workshop for replay link)

@homebodytrainer 63 years old learned her first pull-up at 51 and is always working on new fun ways to move hula hooping, trampoline, handstands, pull-ups 

@baconnfit 60 years old always trying a new fun challenge, insane athlete 

@sixtyandme 60 years old and trying all the things ! Jump roping, hanging, hula hooping and living her life to the fullest 

@carawolder in her 20s and such an inspiration, she shows how women can in fact crush pull-up (better than the guys) 
Is a bad ass in the calthestics  world 

And then there’s me @angela_gargano I’m now 33 years old 🙃, 5x Ninja Warrior who has over come two ACL tears, Miss Fitness America 2016 & creator of @pulluprevolution helping women conquer their first pull-up and become the strongest most confident version of them selves 

Honored to know the ladies above and I will continue to support and be inspired by amazing women like this 🥰

Give these ladies a follow and tag someone that inspires you below 👇🏻👇🏻🙃

Why not gift yourself your first Pull-up this year 😏🎁…

@homebodytrainer and @angela_gargano teamed up to wrap the gift of a pull-up this year 🤣😆! Have to say this was so fun but challenging!

But we know so many of you want to get your pull-up and we are on a mission to make that a reality for all of you ! No matter how old, no matter what ability you’re at! You CAN make it happen 🥳! Comment or message me the world “WORKSHOP” and I’ll send you deets to the next FREE ONLINE PULL-UP MASTERCLASS 🙌🏻
